import React from "react";
import {
  Map,
  GeolocationControl,
  RouteButton,
  SearchControl,
  TrafficControl,
  ZoomControl,
  Placemark,
} from "react-yandex-maps";

function MapBody(props) {
  const iconColorWarehouse = "rgb(30,152,255)";
  const iconColorShop = "red";

  return (
    <div style={{ height: "100%", width: "100%" }}>
      <Map
        style={{ height: "100%", width: "100%" }}
        defaultState={{
          center: [47.222078, 39.720358],
          zoom: 13,
        }}
      >
        <GeolocationControl options={{ float: "left" }} />
        <RouteButton options={{ float: "right" }} />
        <SearchControl options={{ float: "right" }} />
        <TrafficControl options={{ float: "right" }} />
        <ZoomControl options={{ float: "right" }} />
        {props.listPoints.map((item) => (
          <Placemark
            key={item.id}
            geometry={[
              item.geometry.coordinates[1],
              item.geometry.coordinates[0],
            ]}
            options={{
              iconColor: "#0066FF", // Change color of the marker (red in this case)
              balloonContent: "Your label here", // Add label content
            }}
          />
        ))}
      </Map>
    </div>
  );
}

export default MapBody;
